  b 14.01.1936
  b 03.06.1922
  Brigit b. and m. at Whangarei. David, s/o James H F Potter and Marion Knott, b. at Manchester,
  England. Address: 4 Te Paka Crescent, Kamo, Whangarei.
  Brigit spent her early years in Kerikeri but was educated at Whangarei Girls' High School then
  qualified as a Registered Maternity nurse. She spent many years working in maternity hospitals in
  Whangarei and Hamilton and when her children were older she worked in rest homes and attended Polytech
  to do a course on Care of the Elderly. She moved back to Whangarei in 1993 and since her marriage to
  Dave, has settled into a new home. She enjoys gardening and belongs to a bus travel club.
  David served in the Army in 1941-46, landing in France on D-Day. He had a Post Office shop for 23
  years then travelled to New Zealand towing a caravan in 1972-73.
